import React from 'react';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core';

const styles = {
    card: {
        backgroundImage: 'url(${props.url})'
    }
}

const Card = (props) => {
    return (
        <Container style={styles.card}> 
            Text
        </Container>
    );
};

export default Card;
